export default function Camera() {
  return (
    <section className="camera-container">
      <h1>Beauty Product Scanner</h1>
      <p>Use your camera to scan beauty products and analyze their ingredients.</p>
      <div className="camera-view">
        <p className="camera-placeholder">implement</p>
      </div>
      <div className="camera-controls">
        <button className="btn primary-btn">Capture Image</button>
        <button className="btn secondary-btn">Upload Image</button>
      </div>
    </section>
  );
}
